{
    
	if ( ! SeExprEdSpecYY_CURRENT_BUFFER ){
        SeExprEdSpecensure_buffer_stack ();
		SeExprEdSpecYY_CURRENT_BUFFER_LVALUE =
            SeExprEdSpec_create_buffer(SeExprEdSpecin,SeExprEdSpecYY_BUF_SIZE );
	}

	SeExprEdSpec_init_buffer(SeExprEdSpecYY_CURRENT_BUFFER,input_file );
	SeExprEdSpec_load_buffer_state( );
}

/** Switch to a different input buffer.
 * @param new_buffer The new input buffer.
 * 
 */
